import { createContext } from 'react';
import { IBeneficiare } from './types';

interface IApiContext {
  getBeneficiares: ({
    nom,
    prenom,
    matricule,
    rfDirection,
    rfBeneficiaire,
  }: {
    nom: string;
    prenom: string;
    matricule: string;
    rfDirection: string;
    rfBeneficiaire: string;
  }) => Promise<IBeneficiare[]>;

  addBeneficiare: ({
    nom,
    prenom,
    matricule,
    rfDirection,
    rfBeneficiaire,
    centreCout,
  }: {
    nom: string;
    prenom: string;
    matricule: string;
    rfDirection: string;
    rfBeneficiaire: string;
    centreCout: string;
  }) => Promise<IBeneficiare[]>;
  loading: boolean;
  beneficaires: IBeneficiare[] | null;
}

const ApiContext = createContext<IApiContext>({
  getBeneficiares: async () => [],
  addBeneficiare: async () => [],
  beneficaires: [],
  loading: false,
});

export default ApiContext;
